import { useState } from "react";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { tile: "My new website", body: "lorem ipsum...", author: "mario", id: 1 },
    { tile: "Welcome party", body: "lorem ipsum...", author: "yoshi", id: 2 },
    {
      tile: "Web dev top tips",
      body: "lorem ipsum...",
      author: "harshal",
      id: 3,
    },
  ]);

  return <div className="home"></div>;
};

export default Home;
